import React from 'react';

export const Nav = (props) => {
  return(
    <nav>
      {props.pages.map(page => {

        return(
          <button
            className='m-r-5'
            onClick={props.handleNavClick}
            value={page}
            key={page}
          >
            {page}
          </button>
        )})}
    </nav>
  )
}
